Templates.template:
determineValidationState(
	"${oFilterBar}", // sap.ui.mdc.FilterBar
	{
		status: "${status}" // string
	}
)

visualizeValidationState(
	"${oFilterBar}", // sap.ui.mdc.FilterBar
	{
		status: ${status} // sap.ui.mdc.enums.FilterBarValidationStatus
	}
)

updateBinding(
	"${oTable}", // sap.ui.mdc.Table
	"${oBindingInfo}", // sap.ui.base.ManagedObject.AggregationBindingInfo
	"${oBinding}", // sap.ui.model.ListBinding
	{
		forceRefresh: ${bForceRefresh} // boolean
	}
)

isFilterableListItemSelected(
	"${oValueHelp}", // sap.ui.mdc.ValueHelp
	"${oContent}", // sap.ui.mdc.valuehelp.base.FilterableListContent
	{
		getBindingContext: ${fn_getBindingContext} // function
	},
	"${aConditions}" // sap.ui.mdc.condition.ConditionObject[]
)

modifySelectionBehaviour(
	"${oValueHelp}", // sap.ui.mdc.ValueHelp
	"${oContent}", // sap.ui.mdc.valuehelp.base.FilterableListContent
	{
		type: ${type}, // sap.ui.mdc.enums.ValueHelpSelectionType
		conditions: [${conditions}] // sap.ui.mdc.condition.ConditionObject[]
	}
)

parsePasteDataToConditions(
	"${oField}", // sap.ui.mdc.field.FieldBase
	"${aParsedData}", // Array<{value:string,additionalValue:string}>
	{
		defaultOperator: ${defaultOperator}, // sap.ui.mdc.condition.Operator
		valueType: ${valueType}, // sap.ui.model.SimpleType
		additionalValueType: ${additionalValueType} // sap.ui.model.SimpleType
	}
)

updateBinding(
	"${oTable}", // sap.ui.mdc.Table
	"${oBindingInfo}", // sap.ui.base.ManagedObject.AggregationBindingInfo
	"${oBinding}", // sap.ui.model.ListBinding
	{
		forceRefresh: ${bForceRefresh} // boolean
	}
)

fireSelectionDetailsActionPressed(
	{
		action: ${action}, // sap.ui.core.Item
		itemContexts: ${itemContexts}, // sap.ui.model.Context
		level: ${level} // sap.m.SelectionDetailsActionLevel
	}
)

fireChange(
	{
		value: "${value}", // string
		valid: ${bValid}, // boolean
		promise: ${promise} // Promise
	}
)

fireChange(
	{
		value: "${value}", // string
		valid: ${bValid}, // boolean
		conditions: [${conditions}], // object[]
		promise: ${bPromise} // boolean
	}
)

fireChange(
	{
		items: [${items}], // sap.ui.mdc.field.MultiValueFieldItem[]
		valid: ${bValid}, // boolean
		promise: ${promise} // Promise
	}
)

fireBeforeExport(
	{
		exportSettings: ${exportSettings}, // object
		userExportSettings: ${userExportSettings}, // object
		filterSettings: [${filterSettings}] // object[]
	}
)

fireBeforeOpenContextMenu(
	{
		bindingContext: ${bindingContext}, // sap.ui.model.Context
		column: ${column} // sap.ui.mdc.table.Column
	}
)

firePaste(
	{
		data: [${data}] // string[][]
	}
)

fireRowPress(
	{
		bindingContext: ${bindingContext} // sap.ui.model.Context
	}
)

fireSelectionChange(
	{
		selectAll: ${bSelectAll} // boolean
	}
)

fireNavigated(
	{
		leaveFocus: ${bLeaveFocus}, // boolean
		condition: ${condition}, // object
		itemId: "${itemId}", // string
		caseSensitive: ${bCaseSensitive} // boolean
	}
)

fireOpen(
	{
		container: ${container} // sap.ui.mdc.valuehelp.base.Container
	}
)

fireOpened(
	{
		container: ${container}, // sap.ui.mdc.valuehelp.base.Container
		itemId: "${itemId}", // string
		items: ${items} // int
	}
)

fireSelect(
	{
		conditions: [${conditions}], // object[]
		add: ${bAdd}, // boolean
		close: ${bClose} // boolean
	}
)

fireTypeaheadSuggested(
	{
		condition: ${condition}, // object
		filterValue: "${filterValue}", // string
		itemId: "${itemId}", // string
		items: ${items}, // int
		caseSensitive: ${bCaseSensitive} // boolean
	}
)

new sap.ui.mdc.condition.RangeOperator(
	{
		label: [${label}], // string[]
		calcRange: ${fn_calcRange}, // function
		formatRange: ${fn_formatRange}, // function
		defaultValues: [${defaultValues}] // int[]|function
	}
)

fireLiveChange(
	{
		value: "${value}", // string
		escPressed: ${bEscPressed}, // boolean
		previousValue: "${previousValue}" // string
	}
)

fireSubmit(
	{
		promise: ${promise} // Promise
	}
)

focus(
	{
		preventScroll: ${bPreventScroll}, // boolean
		targetInfo: ${targetInfo} // object
	}
)

fireValueHelpRequest(
	{
		fromKeyboard: ${bFromKeyboard} // boolean
	}
)

fireFiltersChanged(
	{
		conditionsBased: ${bConditionsBased}, // boolean
		filtersText: "${filtersText}", // string
		filtersTextExpanded: "${filtersTextExpanded}" // string
	}
)

fireSearch(
	{
		reason: ${reason} // sap.ui.mdc.enums.ReasonMode
	}
)

firePress(
	{
		srcControl: ${srcControl} // sap.ui.core.Control
	}
)

fireConfirm(
	{
		close: ${bClose} // boolean
	}
)

fireNavigated(
	{
		leaveFocus: ${bLeaveFocus}, // boolean
		condition: ${condition}, // object
		itemId: "${itemId}", // string
		caseSensitive: ${bCaseSensitive} // boolean
	}
)

fireOpened(
	{
		itemId: "${itemId}", // string
		items: ${items} // int
	}
)

fireRequestDelegateContent(
	{
		contentId: "${contentId}" // string
	}
)

fireSelect(
	{
		type: ${type}, // sap.ui.mdc.enums.ValueHelpSelectionType
		conditions: [${conditions}] // object[]
	}
)

fireTypeaheadSuggested(
	{
		condition: ${condition}, // object
		filterValue: "${filterValue}", // string
		itemId: "${itemId}", // string
		items: ${items}, // int
		caseSensitive: ${bCaseSensitive} // boolean
	}
)

fireConfirm(
	{
		close: ${bClose} // boolean
	}
)

fireNavigated(
	{
		leaveFocus: ${bLeaveFocus}, // boolean
		condition: ${condition}, // object
		itemId: "${itemId}", // string
		caseSensitive: ${bCaseSensitive} // boolean
	}
)

fireSelect(
	{
		type: ${type}, // sap.ui.mdc.enums.ValueHelpSelectionType
		conditions: [${conditions}] // object[]
	}
)

fireTypeaheadSuggested(
	{
		condition: ${condition}, // object
		filterValue: "${filterValue}", // string
		itemId: "${itemId}", // string
		items: ${items}, // int
		caseSensitive: ${bCaseSensitive} // boolean
	}
)

fireConfirm(
	{
		close: ${bClose} // boolean
	}
)

fireSelect(
	{
		type: ${type}, // sap.ui.mdc.enums.ValueHelpSelectionType
		conditions: [${conditions}] // object[]
	}
)

fireDragEnd(
	{
		bindingContext: ${bindingContext}, // sap.ui.model.Context
		browserEvent: ${browserEvent} // DragEvent
	}
)

fireDragStart(
	{
		bindingContext: ${bindingContext}, // sap.ui.model.Context
		browserEvent: ${browserEvent} // DragEvent
	}
)

firePress(
	{
		bindingContext: ${bindingContext} // sap.ui.model.Context
	}
)
